;; **
;;; ## Evolution
;; **

;; @@
(defn plot-td-evolution [coll]
(let [curr (map :mean (temporal-distance coll t0 tmax :evolution))
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Hours"]
         [:theme_bw]
         [:ggtitle (str "Average temporal distance evolution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mellow-pond/plot-td-evolution</span>","value":"#'mellow-pond/plot-td-evolution"}
;; <=

;; @@
(for [b broadcasters]
  (plot-td-evolution b))
